const videos = [
    {
    name : "Назва відео 1",
    duration: 15,
    id:1,
    },
    {
    name : "Назва відео 2",
    duration: 15,
    id:2,
    },
    {
        name : "Назва відео 3",
        duration: 212,
        id:3,
    },
    {
        name : "Назва відео 4",
        duration: 1123,
        id:4,
    },
]

export function VideoList() {
    return(
        <>
            <h1> Video List </h1>
           {
            videos.map((video) =>{
                return (
                    <div key={video.id}> 
                        <p>{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Лайк!!</button>
                    </div>
                )
            })
           }
        </>
       
    )
}
